        using namespace Ipopt;
        
        // constructor
        Test_NLP::Test_NLP()
        {
          vector<double> injData;
              vector<double> inputData;
        
                n_vars = 7;
                n_ctrl = 1;
                n_pars = 41;
                
          fstream fp;
          int count = 0;
          std::string line;
          specs = new string[100];
          ifstream myfile ("problem_info.txt");
          if (myfile.is_open()){
            while (getline(myfile,line)){
              if (line[0] != '#'){  
                    specs[count] = line;
                    count++;
              }
            }
            myfile.close();
          } 
          else {
            cout << "Unable to open file";
          }
        
          nObs_ = atoi(specs[0].c_str());
          
        
          count = 0;
          std::string li;
		   bounds = new double[300];
          ifstream boundfile ("bounds.txt");
          if (boundfile.is_open()){
            while (getline(boundfile,li)){
              if (li[0] != '#'){  
					std::string input = li;
					std::istringstream ss(input);
					std::string token;
					
					while(std::getline(ss, token, ',')) {
						bounds[count] = atof((token).c_str());
						count++;		
				}
					
              }
            }
            boundfile.close();
          } 
          else {
            cout << "Unable to open file";
          }     
          
        double number;                     
          fp.open("../../data/V1.dat", ios::in | ios::binary);
          if(fp.is_open()){
            while(fp >> number){
              inputData.push_back(number);
              fp.get();
            }
          }
          fp.close();
        
          data_ = new Number[nObs_];
          for (Index i=0; i<nObs_; i++){
          data_[i] = inputData[i];
          }
        
              fp.open("../../data/Iinj.dat", ios::in | ios::binary);
              if(fp.is_open()){
                while(fp >> number){
                  injData.push_back(number);
                  fp.get();
                }
              }
              fp.close();
            
              inj_ = new Number[nObs_];
              for (Index i=0; i<nObs_; i++){
              inj_[i] = injData[i];
              }
            }
                
        //destructor
        Test_NLP::~Test_NLP()
        {
          // make sure we delete everything we allocated
          delete [] data_;
          delete [] inj_;
            }
        
        // returns the size of the problem
        bool Test_NLP::get_nlp_info(Index& n, Index& m, Index& nnz_jac_g,
        				   Index& nnz_h_lag,
        				   IndexStyleEnum& index_style)
        {
          // total number of ipopt problem variables
          n = 9*(nObs_) + 41;
        
          // number of problem constraints 
          m = 15*(nObs_-1)/2; 
        
          // number of non-zero jacobian elements
          nnz_jac_g = 192*(nObs_-1)/2;
        
          // number of non-zero elements in the hessian of the lagrangian
          nnz_h_lag = (88 + 2)*(nObs_)+208;
        
          // use the C style indexing (0-based) for the matrices
          index_style = TNLP::C_STYLE;
        
          return true;
        }
        
        // returns the variable bounds
        bool Test_NLP::get_bounds_info(Index n, Number* x_l, Number* x_u,
        				      Index m, Number* g_l, Number* g_u)
        {
        
		for (Index var = 0; var < n_vars; var++){
			for (Index i=var*nObs_; i<(var+1)*nObs_; i++) {
				x_l[i] = bounds[3*var];
				x_u[i] = bounds[3*var + 1];
			  }
		}
		
		for (Index ctrl = 0; ctrl < n_ctrl; ctrl++){
			for (Index i=(n_vars+ctrl)*nObs_; i<(n_vars+ctrl+1)*nObs_; i++) {
				x_l[i] = bounds[3*(n_vars+ctrl)];
				x_u[i] = bounds[3*(n_vars+ctrl) + 1];
				x_l[i+nObs_] = bounds[3*(n_vars+ctrl+1)];
				x_u[i+nObs_] = bounds[3*(n_vars+ctrl+1) + 1];
			  }
		}
		
		for (Index par = 0; par < n_pars; par++){	
				x_l[(n_vars+2*n_ctrl)*nObs_+par] = bounds[3*(n_vars+2*n_ctrl+par)];
				x_u[(n_vars+2*n_ctrl)*nObs_+par] = bounds[3*(n_vars+2*n_ctrl+par)+1];
		}
                
        
                
          // all constraints are equality constraints with right hand side zero
          for (Index j=0; j<m; j++) {
            g_l[j] = g_u[j] = 0.;
          }
        
          return true;
        }
        
        // returns the initial point for the problem
        bool Test_NLP::get_starting_point(Index n, bool init_x, Number* x,
        					 bool init_z, Number* z_L, Number* z_U,
        					 Index m, bool init_lambda,
        					 Number* lambda)
        {
          // Here, we assume we only have starting values for x, if you code
          // your own NLP, you can provide starting values for the dual variables
          // if you wish
          assert(init_x == true);
          assert(init_z == false);
          assert(init_lambda == false);
          
          for (Index var = 0; var < n_vars; var++){
			for (Index i=var*nObs_; i<(var+1)*nObs_; i++) {
				x[i] = bounds[3*var+2];
			  }
		}
		
		for (Index ctrl = 0; ctrl < n_ctrl; ctrl++){
			for (Index i=(n_vars+ctrl)*nObs_; i<(n_vars+ctrl+1)*nObs_; i++) {
				x[i] = bounds[3*(n_vars+ctrl)+2];
				x[i+nObs_] = bounds[3*(n_vars+ctrl+1)+2];
			  }
		}
		
		for (Index par = 0; par < n_pars; par++){	
				x[(n_vars+2*n_ctrl)*nObs_+par] = bounds[3*(n_vars+2*n_ctrl+par)+2];
		}
        
        
          return true;
        }
        
        // returns the value of the objective function
        bool Test_NLP::eval_f(Index n, const Number* x,
        			     bool new_x, Number& obj_value)
        {
          obj_value = 0.;
          for (Index i=0; i<nObs_; i++) {
            obj_value += (+(data_[i]-x[i])*(data_[i]-x[i])+x[i+7*nObs_]*x[i+7*nObs_]) / nObs_;
          }
          
          return true;
        }
        
        // return the gradient of the objective function grad_{x} f(x)
        bool Test_NLP::eval_grad_f(Index n, const Number* x,
        				  bool new_x, Number* grad_f)
        {
          for (Index i=0; i<n; i++){
            grad_f[i] = 0.0;
          }
          
          for (Index i=0; i<nObs_; i++) {
    grad_f[i] = (-2*data_[i] + 2*x[i]) / nObs_;
    grad_f[i+7*nObs_] = (2*x[i+7*nObs_]) / nObs_;
          }
        
          return true;
        }
        
